import Header from './Header';
import './App.css';

function App() {
    return (
        <div className='App'>
            <Header pageTitle="Frontend"/>
            <div className='container-fluid'>
                <div className='row'>
                    <div className='col'>
                        <p>Hello world!</p>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default App;
